-access_all-agents\"),\n","    x = \"Date\", \n","    y = \"Views (in millions)\"\n","  ) +\n","  theme_minimal(base_size = 14) +\n","  theme(legend.position = \"top\")\n"]},{"cell_type":"markdown","id":"9fee0b2c","metadata":{"papermill":{"duration":0.023198,"end_time":"2025-06-26T04:39:10.20657","exception":false,"start_time":"2025-06-26T04:39:10.183372","status":"completed"},"tags":[]},"source":["## Removing anomalies from the data"]},{"cell_type":"code","execution_count":4,"id":"76827315","metadata":{"execution":{"iopub.execute_input":"2025-06-26T04:39:10.255336Z","iopub.status.busy":"2025-06-26T04:39:10.253454Z","iopub.status.idle":"2025-06-26T04:39:10.269803Z","shell.execute_reply":"2025-06-26T04:39:10.267904Z"},"papermill":{"duration":0.04365,"end_time":"2025-06-26T04:39:10.272704","exception":false,"start_time":"2025-06-26T04:39:10.229054","status":"completed"},"tags":[]},"outputs":[],"source":["# Create a new column 'new_views' where anomalies are replaced with NA\n","top_page_df[, new_views := ifelse(anomaly == -1, NA, Views)]\n"]},{"cell_type":"code","execution_count":5,"id":"d0aaa50f","metadata":{"execution":{"iopub.execute_input":"2025-06-26T04:39:10.381757Z","iopub.status.busy":"2025-06-26T04:39:10.357763Z","iopub.status.idle":"2025-06-26T04:39:10.660354Z","shell.execute_reply":"2025-06-26T04:39:10.657947Z"},"papermill":{"duration":0.366787,"end_time":"2025-06-26T04:39:10.663615","exception":false,"start_time":"2025-06-26T04:39:10.296828","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wT5R8H8O9lNW3TCaW0gCBLQIZsEHEwRH4giiIiLlyIWxG3IuJAZSjiAERU\nEEURBFSQoYgCArKn7E2BDkqbtpl3vz+upMndJblckuaSfN4v/miSy92TS3L58H3ueY7hOI4A\nAAAAIPppIt0AAAAAAAgNBDsAAACAGIFgBwAAABAjEOwAAAAAYgSCHQAAAECMQLADAAAAiBEI\ndgAAAAAxAsEOAAAAIEYg2AEAAADECAQ7AAAAgBiBYAcAAAAQI+Ir2NlLDsyY9Pptfbo2qp+b\nmmRINKXXadDif4Pv+3Te6gpWeM1cp/UowzAMw9y6tzAira1mF46M4l/v1jK7t2WOLurJBMKY\ndhX/ROuFVfw9o4