= \"Seasonal\") +\n","  theme_minimal(base_size = 14) +\n","  theme(axis.text.x = element_text(angle = 45, hjust = 1))\n","\n","trend_plot <- ggplot(decomposed_df, aes(x = Date, y = Trend)) +\n","  geom_line(color = \"red\") +\n","  labs(title = \"Trend\", x = \"Date\", y = \"Trend\") +\n","  theme_minimal(base_size = 14) +\n","  theme(axis.text.x = element_text(angle = 45, hjust = 1))\n","\n","remainder_plot <- ggplot(decomposed_df, aes(x = Date, y = Remainder)) +\n","  geom_line(color = \"purple\") +\n","  labs(title = \"Remainder\", x = \"Date\", y = \"Remainder\") +\n","  theme_minimal(base_size = 14) +\n","  theme(axis.text.x = element_text(angle = 45, hjust = 1))\n","\n","# Arrange the plots in a 4-row layout\n","grid.arrange(observed_plot, seasonal_plot, trend_plot, remainder_plot, ncol = 1)\n"]},{"cell_type":"code","execution_count":22,"id":"32e98b0d","metadata":{"execution":{"iopub.execute_input":"2025-06-26T04:39:15.473168Z","iopub.status.busy":"2025-06-26T04:39:15.471534Z","iopub.status.idle":"2025-06-26T04:39:15.633906Z","shell.execute_reply":"2025-06-26T04:39:15.631898Z"},"papermill":{"duration":0.205997,"end_time":"2025-06-26T04:39:15.637733","exception":false,"start_time":"2025-06-26T04:39:15.431736","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOydeXxTZfq37yTNvnVfgbIVFEXQAQXEBVBkEWRcfg4uuM04DqOOjPuuzDijqKi4\nCzMoqMCoMNMO4ACKgCKKyCLIUqBQoHvSpEmbPef947bP+3DOSZq2adqm9/UHn3KSnPPkZDlX\nvvezKARBAIIgCIIgCKL7o+zsBhAEQRAEQRDxgcSOIAiCIAgiSSCxIwiCIAiCSBJI7AiCIAiC\nIJIEEjuCIAiCIIgkgcSOIAiCIAgiSSCxIwiCIAiCSBJI7AiCIAiCIJIEEjuCIAiCIIgkgcSO\nIAiCIAgiSSCxIwiCIAiCSBJI7AiCIAiCIJIEEjuCIAiCIIgkgcSOIAiCIAgiSSCxIwiCIAiC\nSBJI7AiCIAiCIJIEEjuCIAiCIIgkgcSOIAiCIAgiSSCxIwiCIAiCSBJI7AiCIAiCIJIEEjuC\nIAiCIIgkgcSOIAiCIAgiSSCxIwiCIAiCSBJI7AiCIAiCIJIEEjuCIAiCIIgkgcSOIAiCIAgi\nSSCxIwiCIAiCSBJI7AiCIAiCIJIEEjuCIAiCIIgkgcSOIAiCIAgiSSCxIwiCIAiCSBJI7AiC\nIAiCIJIEEjuCIAiCIIgkgcSOIAiCIAgiS