ad(top_page_df)\n","\n","# Define the training and testing sets\n","train <- top_page_df[top_page_df$Date <= as.Date(\"2016-09-30\"), ]\n","test <- top_page_df[top_page_df$Date >= as.Date(\"2016-10-01\"), ]\n","\n","# Create the plot\n","ggplot() +\n","  geom_line(data = train, aes(x = Date, y = Views, color = \"Training Data\")) +\n","  geom_line(data = test, aes(x = Date, y = Views, color = \"Test Data\")) +\n","  labs(\n","    title = \"Train and Test Data Split\",\n","    x = \"Date\",\n","    y = \"Web Page Views\"\n","  ) +\n","  scale_color_manual(values = c(\"Training Data\" = \"blue\", \"Test Data\" = \"red\")) +\n","  theme_minimal(base_size = 14) +\n","  theme(legend.position = \"top\") +\n","  guides(colour = guide_legend(\"Legend\"))\n"]},{"cell_type":"markdown","id":"09ac3b53","metadata":{"papermill":{"duration":0.046144,"end_time":"2025-06-26T04:39:18.025379","exception":false,"start_time":"2025-06-26T04:39:17.979235","status":"completed"},"tags":[]},"source":["## ACF and PACF of train data"]},{"cell_type":"code","execution_count":32,"id":"cc4f0d9e","metadata":{"execution":{"iopub.execute_input":"2025-06-26T04:39:18.11983Z","iopub.status.busy":"2025-06-26T04:39:18.118144Z","iopub.status.idle":"2025-06-26T04:39:18.473328Z","shell.execute_reply":"2025-06-26T04:39:18.469523Z"},"papermill":{"duration":0.405978,"end_time":"2025-06-26T04:39:18.476566","exception":false,"start_time":"2025-06-26T04:39:18.070588","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3xUVfrH8edOyUwqJZQgiiAYERRUwIKCBf2tCFGyilRRxLIqrl2j6O4qrgUL\ni+4qioIYWUqEKMWOorKIYAEFS7ChRBBIIH36/f1x4xCTSTLJzOQOJ5/3H77GO2fOfe65w+HL\nuXNnNF3XBQAAAAc/i9kFAAAAIDoIdgAAAIog2AEAACiCYAcAAKAIgh0AAIAiCHYAAACKINgB\nAAAogmAHAACgCIIdAACAIgh2AAAAiiDY4aA3qnvGYX3uMLsKAADM13qD3dY1L99yxdiTjunZ\noV2q3ZaQ2rZT3wGnXn7j39/c9GtM9+sueU/TNE3Tbv2xJKY7ik/RPXxv2Y4P38wv2FO8d+cn\nS1et/nGfp1YD3Vd8uNOuaVpi+/9r9EeR37zwCKO2p34tj3q