 and q values\n","best_arima_model <- Arima(train$Views, order = c(best_p, 1, best_q))\n","\n","# Generate forecasts for the test period\n","arima_forecasts <- forecast(best_arima_model, h = nrow(test))\n","arima_forecast_values_mean <- arima_forecasts$mean\n","arima_conf_interval <- arima_forecasts$lower\n","arima_conf_interval_upper <- arima_forecasts$upper\n"]},{"cell_type":"code","execution_count":47,"id":"15187427","metadata":{"execution":{"iopub.execute_input":"2025-06-26T04:39:41.467741Z","iopub.status.busy":"2025-06-26T04:39:41.466002Z","iopub.status.idle":"2025-06-26T04:39:42.618669Z","shell.execute_reply":"2025-06-26T04:39:42.616653Z"},"papermill":{"duration":1.222849,"end_time":"2025-06-26T04:39:42.629222","exception":false,"start_time":"2025-06-26T04:39:41.406373","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd1wT5x8H8O9lEMJWFDBMQVRUwIV71L0tzmq1w1ln3Vprrau/at2jdVK1Vq3W\nvQW3RdwD9wDErYBsQvb9/jiNGFZAY+D4vP/whZcnd9/L5Uk+ufEcw7IsAQAAAEDxJzB3AQAA\nAADwcSDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAA\nAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAA\nTyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAE\ngh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDY\nAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0A\nAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAA\nAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAA\nTyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAE\ngh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDY\nAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0A\nAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAA\nAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AAAAA\nTyDYAQAAAPAEgh0AAAAATyDYAQAAAPAEgh0AA