,"forecast <- forecast(best_arima_model, h = 30)\n","forecast_mean <- forecast$mean\n","\n","# Create a data frame for the last 30 points of the training data and forecasted values\n","train_last_30 <- train[(nrow(train)-29):nrow(train), ]\n","forecast_last_30 <- data.table(\n","  Date = train_last_30$Date,\n","  Views = forecast_mean\n",")\n","\n","# Plot the actual vs predicted values for the last 30 points of the training data\n","ggplot() +\n","  geom_line(data = train_last_30, aes(x = Date, y = Views, color = \"Actual Value\")) +\n","  geom_line(data = forecast_last_30, aes(x = Date, y = Views, color = \"Prediction\")) +\n","  labs(\n","    title = \"Actual vs Predicted Views for the Last 30 Days\",\n","    x = \"Date\",\n","    y = \"Views\"\n","  ) +\n","  theme_minimal(base_size = 14) +\n","  theme(axis.text.x = element_text(angle = 45, hjust = 1)) +\n","  scale_color_manual(values = c(\"Actual Value\" = \"blue\", \"Prediction\" = \"red\")) +\n","  theme(legend.position = \"bottom\") +\n","  guides(colour = guide_legend(\"Legend\"))\n"]},{"cell_type":"markdown","id":"aec22338","metadata":{"papermill":{"duration":0.058476,"end_time":"2025-06-26T04:39:43.719591","exception":false,"start_time":"2025-06-26T04:39:43.661115","status":"completed"},"tags":[]},"source":["## Forecasting using ARIMA model"]},{"cell_type":"code","execution_count":51,"id":"492bfb91","metadata":{"execution":{"iopub.execute_input":"2025-06-26T04:39:43.842555Z","iopub.status.busy":"2025-06-26T04:39:43.840902Z","iopub.status.idle":"2025-06-26T04:39:44.209707Z","shell.execute_reply":"2025-06-26T04:39:44.206821Z"},"papermill":{"duration":0.433733,"end_time":"2025-06-26T04:39:44.213832","exception":false,"start_time":"2025-06-26T04:39:43.780099","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOydd5zUZP7HP5m6nd2lNykqgqKecir2iqLYy89yZ+93VuTU09M7Pc/eENsp6tm7\nYgF7QxSxgiIoINLLsr1MTfL8/sjs7OxMJpP2JNn