te axis to show month and year\n","  theme_minimal(base_size = 14) +\n","  theme(axis.text.x = element_text(angle = 45, hjust = 1)) +\n","  scale_color_manual(values = c(\"Actual Value\" = \"blue\", \"Forecast\" = \"red\")) +\n","  theme(legend.position = \"bottom\") +\n","  guides(colour = guide_legend(\"Legend\"))\n"]},{"cell_type":"markdown","id":"11f60e10","metadata":{"papermill":{"duration":0.060908,"end_time":"2025-06-26T04:39:44.376047","exception":false,"start_time":"2025-06-26T04:39:44.315139","status":"completed"},"tags":[]},"source":["# Exponential smoothing model"]},{"cell_type":"markdown","id":"394db9fb","metadata":{"papermill":{"duration":0.060702,"end_time":"2025-06-26T04:39:44.497592","exception":false,"start_time":"2025-06-26T04:39:44.43689","status":"completed"},"tags":[]},"source":["## Prediction"]},{"cell_type":"code","execution_count":52,"id":"bb494973","metadata":{"execution":{"iopub.execute_input":"2025-06-26T04:39:44.622343Z","iopub.status.busy":"2025-06-26T04:39:44.620644Z","iopub.status.idle":"2025-06-26T04:39:44.941115Z","shell.execute_reply":"2025-06-26T04:39:44.93823Z"},"papermill":{"duration":0.386717,"end_time":"2025-06-26T04:39:44.944678","exception":false,"start_time":"2025-06-26T04:39:44.557961","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2AT5f8H8PdlJ90F2rKRJVNcTCciiuLWn4oTt3wdKPJ1fl04wImCAwe4v26/\nOHCxnAgiylZBWbJK90ibZt3vjyc90jZNkza5uyTv119ter08d7lc3vk8d88jybIMIiIiIkp8\nBq0bQERERESxwWBHRERElCQY7IiIiIiSBIMdERERUZJgsCMiIiJKEgx2REREREmCwY6IiIgo\nSTDYERERESUJBjsiIiKiJMFgR0RERJQkGOyIiIiIkkTKBbuS9TdL9YbOWKt1c1rJV7dNbMLZ\nv5do3ZbGtn08RmqGyZae36X32DMvef5/P/k1al7F1qmiMb85PeKRuoql4pGpWys0alQLmra5\nKdlb2t1mliTJnntCi9M/f3V2T7HC53ZXIxH2QITKf//4orFDc9OtFnvWVb+XatkUuU7s0lNW\nFKr8zDN75UiSZEkbqPLzJqgNT48IebIyGK0dOvU49Mjxdz728u8Vbq2bqRe6Oldsfu3o5j5r\nGn/0WDtp3VhVpVywWzrlQ+XnjTNnxGSdnoqSwsLCouLqmKwtifnqnPt2/b1o/hv/OmtUv/FT\nS71apbtY0smrL5lyZ43